import './chatTile.css';

const ChatTile = () => {
  return (
    <>
      <div className='chatTile'>
        <div id='userTile'>
          <div className='user'>
            {/* shows user's image */}
            <img src={defaultUser} alt='user image' id='userImage' />

            {/* shows user's name */}
            <p id='username'>User Name</p>
          </div>

          <div id='icons'>
            {/* other settings, e.g. edit, delete */}
            <img src={more} alt='more' className='icon' />
            <img src={edit} alt='edit' className='icon' />
          </div>
        </div>
        this is a chat tile</div>
    </>
  );
}

export default ChatTile;
